import React from 'react';
import { 
  Table, TableBody, TableCell, TableContainer, 
  TableHead, TableRow, Paper, Button, Typography 
} from '@mui/material';

function PeopleList({ people, onContact }) {
  return (
    <div>
      <Typography variant="h6" gutterBottom>
        People List
      </Typography>
      {people.length === 0 ? (
        <Typography>No people found for this zip code.</Typography>
      ) : (
        <TableContainer component={Paper} sx={{ mt: 2 }}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Name</TableCell>
                <TableCell>Email</TableCell>
                <TableCell>Phone</TableCell>
                <TableCell>Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {people.map((person) => (
                <TableRow key={person.id}>
                  <TableCell>{person.first_name} {person.last_name}</TableCell>
                  <TableCell>{person.email}</TableCell>
                  <TableCell>{person.phone}</TableCell>
                  <TableCell>
                    <Button 
                      variant="outlined" 
                      onClick={() => onContact(person.email, 'A')} 
                      sx={{ mr: 1 }}
                    >
                      Contact A
                    </Button>
                    <Button variant="outlined" onClick={() => onContact(person.email, 'B')}>
                      Contact B
                    </Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
    </div>
  );
}

export default PeopleList;
